$(document).on('click','.react',function() {

    var dt = $(this).attr('id');

    var news_id = $(this).attr('news-id');

    $.ajax({
        type: 'POST',
        url: 'https://app.dream.co.id/react/',
        data: 'dt=' + dt + '&news_id=' + news_id,
        cache: false,
        success: function(data)
        {
            var json = jQuery.parseJSON(data); //DATA PERSENTASE

            var sum = 0;
            $.each(json, function(i, item) {
                sum += parseInt(json[i]);
            });

            $('.react').each(function(){
                if ($(this).attr('id') == dt) {
                    if (json[$(this).attr('id')] == 0){
                        json[$(this).attr('id')] = 1; //IF VAL == 0 PUSH TO 1
                        sum = sum+1; //MAKE SUM +1 TO
                    }
                }
            });

            $('.react').click(false); //REMOVE CLICK

            $('.react').each(function(){

                $(this).removeAttr('href'); //REMOVE EACH HREF

                $(this).removeClass('has-hover'); //REMOVE EACH HOVER

                if ($(this).attr('id') != dt) {
                    $(this).attr('id', function(){
                        $(this).children('.img').addClass('disapear'); //MAKE TRANSPARENT
                        $(this).children('.info').addClass('disapear'); //MAKE TRANSPARENT
                    });
                } else {
                    $(this).addClass('active'); //MAKE ACTIVE
                }

                $(this).attr('id', function(){

                    var val = ((parseInt(json[$(this).attr('id')])) / sum) * 100; //COUNT PERSENTASE
                    if (val % 1 !== 0) val = Math.round(val);

                    $(this).children('.persen').html(val + '%'); //CHANGE VALUE TO DB RESULT

                    if(val != 0) $(this).children('.persen').removeClass('hidden'); //SHOW EACH PERSEN

                });
            });
        }
    });
});
